import { set } from './set';
import { pipe } from './pipe';
describe('data first', function () {
    test('set', function () {
        expect(set({ a: 1 }, 'a', 2)).toEqual({ a: 2 });
    });
});
describe('data last', function () {
    test('set', function () {
        expect(pipe({ a: 1 }, set('a', 2))).toEqual({ a: 2 });
    });
});
